import React from 'react';
import { View, Text, TouchableOpacity } from 'react-native';

import styles from './styles';

const BottomButton = ({
  onPress,
  text,
  containerStyleAdd,
  touchStyleAdd,
  textStyleAdd,
  containerStyle,
  touchStyle,
  textStyle,
}) => {
  return (
    <View style={containerStyle || [styles.container, container]}>
      <TouchableOpacity
        onPress={onPress}
        style={touchStyle || [styles.touch, touch]}
      >
        <Text style={textStyle || [styles.text, text]}>{text}</Text>
      </TouchableOpacity>
    </View>
  );
};

export default BottomButton;
